import knexConfigs from '../knex.configs';

async function seed(pg) {
  // Inserts seed entries
  try {
    await pg('home_page_en').insert({
      main: {
        first: {
          text1: 'John Doe',
          text2: 'John Doe',
          text3: 'John Doe',
          text4: 'John Doe',
          background: "sdgjkfg.png",
          link: "shop Now"
        },
        second: {
